                <div className="row">
                    {projects.map(project => (
                        <Card
                            title={project.title}
                            image={project.image}
                            description={project.description}
                            profileUrl={project.url}

                        />
                    ))}

                </div>
            </div>
        </div>
    )
}

export default Homepage;
